import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4 3a2 2 0 00-1 3.73v9.52c0 2.35 1.9 4.25 4.25 4.25h6v3h-4.5a.75.75 0 000 1.5h10.5a.75.75 0 000-1.5h-4.5v-3h6c2.35 0 4.25-1.9 4.25-4.25V6.73A2 2 0 0024 3H4zm.5 4h19v9.25A2.75 2.75 0 0120.75 19H7.25a2.75 2.75 0 01-2.75-2.75V7z", fill: primaryFill }));
};
const ProjectionScreen28Regular = wrapIcon(rawSvg({}), 'ProjectionScreen28Regular');
export default ProjectionScreen28Regular;
